import './styles/App.css';
import './styles/parallax.css';
import './styles/lens-flare.css';
import LensBlinkJSX from './components/lens-blink';
import $ from 'jquery';

function App() {

  const windowWidth = $(window).width();
  const windowHeight = $(window).height;
  console.log(windowHeight);

	const prescaleBackgroundSize = {
    height: 1080,
    width: 1920
  };

  const prescaleOriginCoordinates = {
    left: 885,
    top: 646
  };

  const Blink1 = LensBlinkJSX(
    <div className="lens-blink" id="blink-1"></div>,
    prescaleOriginCoordinates,
    {top: 0, left: 0}
  );

  const Blink2 = LensBlinkJSX(
    <div className="lens-blink" id="blink-2"></div>,
    prescaleOriginCoordinates,
    {top: 0, left: 0}
  );

	return (
    <div className="main">
      <div className="parallax">
        <div className="parallax-group">

          <div className="parallax-layer parallax-layer--back">
            <img className="background" src="./media/background3.png"/>
          </div>


          <div id="lens-flare">
            <Blink1 />
            <Blink2 />
          </div>


          <div className="parallax-layer parallax-layer--base">

          </div>

        </div>
      </div>
    </div>
	);
}

export default App;
